import React from 'react';
import {
  Button,
  Form,
  Grid,
  Header,
  Message,
  Segment,
  Icon,
  Image
} from 'semantic-ui-react';
import myImage from './download.jpeg';

/*for(var x=0;x<1001;x++){
    elements.push(x);
}*/

const elements =  [
    {
      name: "😃 William",
      location: "🏘️ Lagos",
      car: "🚘 Honda"
    },
    {
      name: "😃 Chris",
      location: "🏘️ Moon",
      car: "🚘 Tesla"
    },
    {
      name: " 😃 Rose",
      location: "🏘️ Venice",
      car: "🚘 Pagani"
    },
    {
      name: "😃 Mike",
      location: "🏘️ Milan",
      car: "🚘 Rolls Royce"
    },
    {
      name: "😃 Liz",
      location: "🏘️ Beirut",
      car: "🚘 Mercedes"
    }
  ];


export default () => (
  <Grid centered columns={2}>
    <Grid.Column>
      <Header as="h2" textAlign="center">
         Congrats Cat and Jenny
      </Header>

      <Segment>
      <Image src={ myImage } fluid/>

        <Form size="large">
            <Message
                success
                icon='thumbs up'
                header='Nice job!'
                content='Your profile is complete.'
            />
            <div>

            </div>
            {elements.map((user, index) => (
          <div key={index} color="black">
            <h3>{user.name}</h3>
            <p>{user.location}</p>
            <p>{user.car}</p>
          </div>
        ))}
        </Form>
      </Segment>
      <Message>
      1000 wishes for a happy 2021!
      </Message>
    </Grid.Column>
  </Grid>
);
